package tutorialweek2;

public class QN4 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		if(5>3 && 8>5) {
			System.out.println("AND-Operator");
		}
		if (5>3 || 2>5) {
			System.out.println("OR-Operator");
		}
		if (!(5==10)) {
			System.out.println("NOT-Operator");
		}
		
	}

}
